import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  formData = {
    name: '',
    email: '',
    gender: '',
  };

  submitForm() {

    if (this.formData.name && this.formData.email) {

      console.log('Form send !');
      console.log('Name:', this.formData.name);
      console.log('Email:', this.formData.email);
      console.log('Gender:', this.formData.gender);

      this.formData.name = '';
      this.formData.email = '';
      this.formData.gender = '';
    } else {
      console.log('Please fill in all the fields of the form.');
    }
  }
}
<h1>Form</h1>

<form (submit)="submitForm()">
  <div>
    <label for="name">Name:</label>
    <input type="text" id="name" [(ngModel)]="formData.name" name="name" required>
  </div>

  <div>
    <label for="email">Email:</label>
    <input type="email" id="email" [(ngModel)]="formData.email" name="email" required>
  </div>

  <div>
    <label for="gender">Gender:</label>
    <input type="text" id="gender" [(ngModel)]="formData.gender" name="gender" required>
  </div>

  <button type="submit" id="submit">Send</button>
</form>
